import { createApp } from 'vue'
import App from './App.vue'
import {create} from 'naive-ui';
import router from './router'; 
import pinia from './store'; // 导入 store 目录

const naive = create();

const app = createApp(App);
app.use(naive);
app.use(router);
app.use(pinia);
app.mount('#app');


